"""# BFS

<p style="text-align: justify">Reached is a set of states which has been generated, because once weve reached a state, we can never find a better path to the state. That also means we can do an early goal test, checking whether a node is a solution as soon as it is generated, rather than the late goal test that best-first search uses, waiting until a node is popped off the queue.</p>
"""

def bfs(start, goal, G):
    generated= [start] # to store the order of nodes generated
    frontier = [{'Name':start,'Path cost':0, 'Path':[start]}]

    while len(frontier) > 0:
        print('***Frontier', end=': ')
        for node in frontier: print(node['Name'], end = ' - ')
        unode  = frontier.pop(0)     # selceting the node to expand
        u = unode['Name']

        print('***')
        print("Expanding: "+u)

        # expand u
        for v in G[u].keys(): # ['Sibiu', 'Zerind', 'Timisoara']
            if v not in generated: # process if v is not /GENERATED yet
                generated.append(v)
                print(v+" generated.")
                cost = unode['Path cost'] + G[u][v]
                path =  unode['Path']+ [v]
                vnode = {'Name': v,'Path cost': cost,'Path': path}
                # goal test
                if v == goal:
                    print('Goal test satisfied.')
                    return vnode # breaking from while
                frontier.append(vnode)# store the generated node in the frontier

    print('Failed')

